import React, {Component} from 'react';
import './layout.css';

class Header extends Component{
  render(){
    return(
        <header className="MuiPaper-root MuiAppBar-root MuiAppBar-positionAbsolute jss315 jss316 MuiAppBar-colorPrimary MuiPaper-elevation4">
            <div className="MuiToolbar-root MuiToolbar-regular jss313 MuiToolbar-gutters">
                <button className="MuiButtonBase-root MuiIconButton-root jss317 jss318 MuiIconButton-colorInherit MuiIconButton-edgeStart" tabindex="0" type="button" aria-label="open drawer">
                    <span className="MuiIconButton-label">
                    <svg className="MuiSvgIcon-root" focusable="false" viewBox="0 0 24 24" aria-hidden="true" role="presentation">
                    <path d="M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z"></path></svg></span>
                    <span className="MuiTouchRipple-root"></span>
                </button>
                <h1 className="MuiTypography-root jss319 MuiTypography-h6 MuiTypography-colorInherit MuiTypography-noWrap">Dashboard</h1>
                <button className="MuiButtonBase-root MuiIconButton-root MuiIconButton-colorInherit" tabindex="0" type="button">
                    <span className="MuiIconButton-label">
                    <span className="MuiBadge-root">
                    <svg className="MuiSvgIcon-root" focusable="false" viewBox="0 0 24 24" aria-hidden="true" role="presentation"></svg>
                    <span className="MuiBadge-badge MuiBadge-anchorOriginTopRightRectangle MuiBadge-colorSecondary">4</span></span></span>
                    <span className="MuiTouchRipple-root"></span>
                </button>
            </div>
        </header>
    );
  }
}

export default Header;
